// import React from 'react';
import logo from './logo.svg';
import './App.css';

import axios from 'axios';

import React, { useEffect, useState } from 'react';


interface Taxon {
  guid: string;
  scientificName: string;
  commonName: string;
}

interface Person {
  firstName: string;
  lastName: string;
}

interface ApiData {
  datasetTitle: string;
  datasetDescription: string;
  institutionCode: string;
  geographicalDescription: string;
  taxonomicCoverage: Taxon[];
  sensorTypes: string;
  curator: Person[];
  creator: Person[];
  contact: Person[];
  geographicalCoverage: { [key: string]: string };
  license: string;
  Version: string;
  bibliographicCitation: { [key: string]: string };
  updateFrequency: string;
  animalCount: number;
}


function App() {
  const [apiData, setApiData] = useState<ApiData | null>(null);
  // const [apiData, setApiData] = useState(null);
  const apiUrl = 'http://canmove-dev.ekol.lu.se:8080/sensorAPI/v1/dataset/LU_trackingradar_Lundfixed_2006-13';
  // const apiUrl = 'https://canmove-dev.ekol.lu.se:8080/sensorAPI/v1/datasets';


  // const apiUrl = 'https://api.coindesk.com/v1/bpi/currentprice.json'; //works


  useEffect(() => {
    const fetchData = async () => {
      try {
        // Make a GET request to fetch data from the API using Axios
        const response = await axios.get(apiUrl);

        // Axios automatically checks for a successful response (status code 200-299)
        // Parse the response data
        const data = response.data;

        // Set the fetched data in the component's state
        setApiData(data);
      } catch (error) {
        if (error instanceof Error) {
          console.error('Error fetching data:', error.message);
        } else {
          console.error('Unexpected error:', error);
        }
      }
    };

    // Call the fetchData function when the component mounts
    fetchData();
  }, []); // The empty dependency array ensures that this effect runs once after the initial render

  return (
    <div className="App">
      <header className="App-header">


        {apiData ? (
          <div>

            <div className="fetched-data-container">

            <h2>Details</h2>

            <div className="fetched-data-row">
              <h2 className="title">Dataset Title</h2>
                <p>{apiData.datasetTitle}</p>
            </div>

            <div className="fetched-data-row">
              <h2 className="title">Dataset description</h2>
                <p>{apiData.datasetDescription}</p>
            </div> 


            <div className="fetched-data-row">
              <h2 className="title">Institution</h2>
                <p>{apiData.institutionCode}</p>
            </div> 


            <div className="fetched-data-row">
              <h2 className="title">Animal Count</h2>
              <p>{apiData.animalCount}</p>
            </div>


            <div className="fetched-data-row">
              <h2 className="title">Start date - End Date</h2>
              NO
            </div>


            <div className="fetched-data-row">
              <h2 className="title">Geographical Description</h2>
                <p>{apiData.geographicalDescription}</p>
            </div> 


            <div className="fetched-data-row">
              <h2 className="title">Taxon | commonName</h2>
                {/* <p>{apiData.taxonomicCoverage}</p> */}
            </div>

                            <div className="fetched-data-row">
                              <h2 className="title">Taxon | commonName</h2>
                              {apiData.taxonomicCoverage.map((taxon, index) => (
                                <div key={index}>
                                  <span>Guid: {taxon.guid}</span>
                                  <span>Scientific Name: {taxon.scientificName}</span>
                                  <span>Common Name: {taxon.commonName}</span>
                                </div>
                              ))}
                            </div>


            <div className="fetched-data-row">
              <h2 className="title">SensorType</h2>
                <p>{apiData.sensorTypes}</p>
            </div> 


                            <div className="fetched-data-row">
                              <h2 className="title">contactCuratorOwner | Firstname & LastName</h2>
                              {apiData.curator.map((person, index) => (
                                <div key={index}>
                                  <span>First Name: {person.firstName}</span>
                                  <span>Last Name: {person.lastName}</span>
                                </div>
                              ))}
                            </div>


                            <div className="fetched-data-row">
                              <h2 className="title">contactCreator | Firstname & LastName</h2>
                              {apiData.creator.map((person, index) => (
                                <div key={index}>
                                  <span>First Name: {person.firstName}</span>
                                  <span>Last Name: {person.lastName}</span>
                                </div>
                              ))}
                            </div>


                            <div className="fetched-data-row">
                            <h2 className="title">contactQuestions | Firstname & LastName</h2>
                            {apiData.contact.map((person, index) => (
                              <div key={index}>
                                <span>First Name: {person.firstName}</span>
                                <span>Last Name: {person.lastName}</span>
                              </div>
                            ))}
                          </div>


                          <div className="fetched-data-row">
                            <h2 className="title">Geographical coverage</h2>
                            {Object.keys(apiData.geographicalCoverage).map((key, index) => (
                              <div key={index}>
                                <span>{key}: {apiData.geographicalCoverage[key]}</span>
                              </div>
                            ))}
                          </div>


            <div className="fetched-data-row">
              <h2 className="title">Dataset License</h2>
                <p>{apiData.license}</p>
            </div>

            <div className="fetched-data-row">
              <h2 className="title">Institution codes</h2>
                <p>{apiData.institutionCode}</p>
            </div>


                        <div className="fetched-data-row">
                          <h2 className="title">dataset references</h2>
                          {Object.entries(apiData.bibliographicCitation).map(([key, value], index) => (
                            <div key={index}>
                              <span>{key}: {value}</span>
                            </div>
                          ))}
                        </div>


            <div className="fetched-data-row">
              <h2 className="title">Update frequency</h2>
                <p>{apiData.updateFrequency}</p>
            </div>

            <div className="fetched-data-row">
              <h2 className="title">Version</h2>
                <p>{apiData.Version}</p>
            </div>


            <div className="fetched-data-row">
              <h2 className="title">Bibliographic Citation</h2>
              {Object.keys(apiData.bibliographicCitation).map((key, index) => (
                <div key={index}>
                  <span>{key}: {apiData.bibliographicCitation[key]}</span>
                </div>
              ))}
            </div>


            <pre>{JSON.stringify(apiData, null, 2)}</pre>

            </div>
</div>
) : (
<p>Loading data...</p>
)}
</header>
</div>
  );



}

export default App;
